protected void creerChamps()
{
mWD_EDT_Email = new GWDEDT_Email();
mWD_EDT_Password = new GWDEDT_Password();
mWD_STC_Identification = new GWDSTC_Identification();
mWD_CBOX_Checkbox = new GWDCBOX_Checkbox();
mWD_BTN_Cadastro = new GWDBTN_Cadastro();
mWD__EXPRESSVersion = new GWD_EXPRESSVersion();

}
////////////////////////////////////////////////////////////////////////////
// Initialisation de la fenêtre WIN_Login
////////////////////////////////////////////////////////////////////////////
public  void initialiserObjet()
{
super.setQuid(2728415818743794653l);

super.setChecksum("1642968417");

super.setNom("WIN_Login");

super.setType(1);

super.setBulle(WDChaineMultilangue.getString("", ""));

super.setMenuContextuelSysteme();

super.setCurseurSouris(0);

super.setNote("", WDChaineMultilangue.getString("", ""));

super.setCouleur(0x0);

super.setCouleurFond(0xFFFFFF);

super.setPositionInitiale(0, 0);

super.setTailleInitiale(440, 360);

super.setTitre(WDChaineMultilangue.getString("Log in", "Log in"));

super.setTailleMin(-1, -1);

super.setTailleMax(20000, 20000);

super.setVisibleInitial(true);

super.setPositionFenetre(1);

super.setPersistant(true);

super.setGFI(true);

super.setAnimationFenetre(0);

super.setImageFond(WDChaineMultilangue.getString("", ""), 1, 0, 1);

super.setCouleurTexteAutomatique(0xF4000000);

super.setCouleurBarreSysteme(0xFF000001);

super.setCopieEcranAutorisee(true);


activerEcoute();

////////////////////////////////////////////////////////////////////////////
// Initialisation des champs de WIN_Login
////////////////////////////////////////////////////////////////////////////
mWD_EDT_Email.initialiserObjet();
super.ajouter("EDT_Email", mWD_EDT_Email);
mWD_EDT_Password.initialiserObjet();
super.ajouter("EDT_Password", mWD_EDT_Password);
mWD_STC_Identification.initialiserObjet();
super.ajouter("STC_Identification", mWD_STC_Identification);
mWD_CBOX_Checkbox.initialiserObjet();
super.ajouter("CBOX_Checkbox", mWD_CBOX_Checkbox);
mWD_BTN_Cadastro.initialiserObjet();
super.ajouter("BTN_Cadastro", mWD_BTN_Cadastro);
mWD__EXPRESSVersion.initialiserObjet();
super.ajouter("#EXPRESSVersion", mWD__EXPRESSVersion);

super.terminerInitialisation();
}

